import React from 'react'
import styled from 'styled-components';
import BACKGROUND_IMAGE from '../../assets/Background.png'
import { Button, Container, Content, Divider, Panel, Stack, VStack ,Form} from 'rsuite';
import FaGithub from '@rsuite/icons/Trash'
const Login = () => {
  return (
    <Background>
        <Container>


       <Content>
        <Stack alignItems="center" justifyContent="center" style={{ height: '100%' }}>
          <Panel header="Sign in" bordered style={{ width: 400 }}>
            <Form fluid>
              <Form.Group>
                <Form.ControlLabel>Email address</Form.ControlLabel>
                <Form.Control name="name" />
              </Form.Group>
              <Form.Group>
                <Form.ControlLabel>Password</Form.ControlLabel>
                <Form.Control name="password" autoComplete="off"  />
              </Form.Group>

              <VStack spacing={10}>
                <Button appearance="primary" block>
                  Sign in
                </Button>
                <a href="#">Forgot password?</a>
              </VStack>
            </Form>

            <Divider>OR</Divider>

            <Button endIcon={<FaGithub />} block href="https://github.com/rsuite/rsuite">
              Continue with Github
            </Button>
          </Panel>
        </Stack>
      </Content>
      </Container>
    </Background>
  )
}

export default Login
const Background = styled.div`
width: 100%;
background-image:url(${BACKGROUND_IMAGE}) ; 
background-size: 100vw 100vh;
background-repeat: no-repeat;
object-fit: scale-down;
z-index:1;
height: 100vh;
box-shadow: inset 0 0 0 2000px rgba(255, 0, 150, 0.3);
`;
